import React from 'react'

const Button = ({ type, text, onClick }) => {        
    switch(type.toLowerCase()) {
        case "primary":
            return <button className="bg-[#000000] px-[1rem] py-[0.1rem] text-[1.5rem] rounded-xl" onClick={onClick}>{text}</button>
            break;
        case "default":
            return <button className="bg-[#FFFFFF] px-[3rem] py-[1.5rem] " onClick={onClick}>{text}</button>
            break;
        default:
            
    }
}

export default Button
